  state = {
    movies: [
      {id: 'abc1', name: 'JS Basics'},
      {id: 'abc2', name: 'JS Anvanced'},
      {id: 'abc3', name: 'React JS'}
    ],
  }
  render() {
    return <>
            <Header />
            <Main />
            <Footer />
          </>
  }


}

export default App;
